package com.example.miniprogect1.domain;import jakarta.persistence.*;import lombok.Data;import lombok.Getter;import lombok.Setter;@Entity@Getter@Setterpublic class ImgPath {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long uId;    private String FileName;    private String FilePath;    @ManyToOne    @JoinColumn(name = "user_id", nullable = false)    private User user;}